import React from 'react'
import Link from 'next/link'
import { navbarLinks as link } from '../../NavigationMenu'
import { FiAirplay } from 'react-icons/fi'
import { FiAlignRight } from 'react-icons/fi'


function Minnav(clicks, toggle) {

    return (
        <div className={clicks ? "bg-[#1d2128] text-center items-center" : " none "}>
            <div className="h-40 text-white">

                {link.map((nav) => {
                    const { id, text, path } = nav;
                    return (

                        <li as={`/${nav.path}`} href='/[pages]'>

                            <a>{text}</a>
                        </li>

                    )
                })}
                <div className="bg-red h-20 w-40 border-2" onClick={toggle}>
                    {
                        clicks ? <FiAirplay /> : <FiAlignRight />
                    }
                </div>

            </div>



            <div className="h-6 bg-black md:hidden border-b-[1px]" style={{
                borderTopRightRadius: '30px',
                borderTopLeftRadius: '30px',
            }}
            >

            </div>
        </div>
    )
}

export default Minnav
